import React from 'react'
import Navbar from '../Navbar'
import { useNavigate } from 'react-router-dom'
import dataArr from '../../../CoursesFolder/MainCourseData'
import './Courses.css'
const Courses = () => {
  const nv = useNavigate();
  return (
    <div>
      <Navbar />
      <data className="topBarScroll row">
        dd
        <div className="scrollTemp col-10">
          {dataArr.map((item) => (
            <button onClick={() => {
              nv(item.cLink)
            }}>
              <img src={item.cImg} alt="" />
            </button>
          ))}
        </div>
      </data>
      <br />
      <div className="CoursesFolder">
        {
          dataArr.map((item) => (
            <div className='mainCDiv row'>
              <button className='cardBtn col-md-4  ' onClick={() => {
                nv(item.cLink)
              }}>
                <div className="cardC">
                  <img src={item.cImg} className='courseImg' alt="" />
                  <hr /><p className="Ctitle">{item.cName}</p>
                  <hr /><input type="button" className='mybtn' value="Click" onClick={() => {
                    nv(item.cLink)
                  }} />
                </div>
              </button>
              <div className="col-md-7 textBlock">
                {item.desc}
              </div>
            </div>
          ))

        }


      </div>
      {window.scrollTo({ top: 0, behavior: 'smooth' })}
    </div >

  )
}

export default Courses
